import React, { Component } from 'react';
import SignIn from 'D:/uni/tamago/ui/src/components/SignIn/SignIn.js';
import SignUp from 'D:/uni/tamago/ui/src/components/SignIn/SignUp.js';

class switchButton extends Component {
	constructor(){
  		super()
    	this.state={
      	showMe:true
    	}
  	}
  	operation()
	{
	  this.setState({
	    showMe:!this.state.showMe
	  })
	}

  	render() {
  		return (
  			<div className="container">
				<button>Switch</button>
			</div>
  		);
  	}

}

export default switchButton;
